import React from 'react';



class NumberDisplay extends React.Component {
    constructor(props) {
        super(props);

        this.props = {
            value: props.value,
            suffix: props.suffix,
            unit: props.unit
        }
    }



    render() {
        return (
            <div>
                {this.props.value}{this.props.suffix} {this.props.unit}
            </div>
        );
    }
}

export default NumberDisplay;
